text:
Sekeras apapun kritik kalian namun tdak akan mngubah cinta dan sayang Rakyat Jawa Barat...
   Ingat hal yg Kalian Lakukn ini akn mnjdi bumerang bagi TEMPO  di kedepannya...
    Maka kmbali sy dan para pecinta KDM  lainnya malah ingin mmpertanyakn kpda kalian Apa yg kalian buat untuk Publik Terutama Rakyat indonesia... Selain Hnya mmbangun Opini pmbunuhan Karakter kalian kpda Sosok KDM....
Dan sy yakin KDM malah akn lbih bertambah Populer di kmudian hari...
  Jujur Siasat yg di lakukan KDM ni dengan tim nya Justru tepat sasaran dan berdampak Positif  bagi Rakyat indonesia terkhusus Wilayah Jawa Barat...
  Maju Trus KDM smua demi kbaikn yg di dalam Agama   disebut..." Khirunnas Anfa Uhum Linnas..." (Sebaik baik Manusia di sisi Tuhan adalah manusia yg bermanfaat bagi sesama nya)❤❤❤
